import vector from '../Assets/Vector.png';
function App() {
    return (
<div className="App w-[100vw] h-[96vh] flex  gap-[1vh] justify-center  overflow-y-auto">
            <div className="w-[60vw] h-[90vh] bordertest flex flex-col items-center">
                <img src={vector}></img>
            </div>
      </div>
    );
  }
  
export default App;
